```
render() {
  return (
    <Button
      {...this.props}
      onClick={this.handleClick}
    />
  );
}
```
```
render() {
  return React.cloneElement(Button, {
    ...this.props,
    onClick: this.handleClick,
  });
}
```
## Answer

The first example is the idiomatic way to render a component. The second example is unidiomatic and should be avoided.

React.cloneElement() is almost never used when writing idiomatic React components. It's mostly an escape hatch that you might need if you create libraries that operate on elements passed to you by other programmers. It's generally not needed in application-level code.

